// Initialize graphics interface by enabling LCD.
// Inputs:  none
// Outputs: none
void Graphics_init(void) {
  ST7735_InitR(INITR_REDTAB);
  ST7735_FillScreen(ST7735_WHITE);
	ST7735_DrawBitmap(5, 115, cocktail_image, 70, 70);
	ST7735_DrawBitmap(100, 150, loading_letters, 14, 141);
}

// Private function to print the time to the LCD.
// Note that the cursor location is assumed to be previously set.
void print_time(int hour, int minute, int second) {
	ST7735_SetTextColor(ST7735_BLUE);
  if (hour < 10) {
    ST7735_OutString("0");
  }
  ST7735_OutUDec(hour);
  ST7735_OutString(":");
  if (minute < 10) {
    ST7735_OutString("0");
  }
  ST7735_OutUDec(minute);
  ST7735_OutString(":");
  if (second < 10) {
    ST7735_OutString("0");
  }
  ST7735_OutUDec(second);
}

// Draws the Main menu on the ST7735, but not the ratio bar and time
// Inputs: None
// Outputs: None
void Grahpics_DrawMainMenu(void){
	ST7735_DrawBitmap(0, 159, main_menu, 128, 160);
}

// Updates the time and proportions bar on the main menu
// Inputs: uint8_t hours, minutes, and seconds
// Inputs: numerator and denominator for ratio of liquid 1
// Outputs: None
void Graphics_UpdateMainMenu(uint8_t hours, uint8_t minutes, uint8_t seconds, uint32_t num, uint32_t denom){
	ST7735_DisplayRatioBar(32, 0, 10, 110, ST7735_RED, ST7735_BLUE, num, denom);
	ST7735_SetRotation(1);
	ST7735_SetCursor(9, 12);
	print_time(hours, minutes, seconds);
	ST7735_SetRotation(0);
}

uint16_t progress;
// *************** Graphics_ProgressDisplayInit ********************
// Used to initialize progress display
// Input: none
// Output: none
void Graphics_ProgressDisplayInit(void) {
   ST7735_DrawBitmap(0, 159, ProgressDisplay, 128, 160);
   progress = 0;
}

// *************** Graphics_ProgressDisplayUpdate ********************
// Used to display ratio bar
// Creates a progress bar that is the 160 pixels wide
// Input: currentProgress   current progress of the pour
//        totalProgress     the eventual total progress
// Output: none
void Graphics_ProgressDisplayUpdate(int16_t currentProgress, int16_t totalProgress) {
   ST7735_FillRect(20, progress, 10, (160 * currentProgress) / totalProgress, ST7735_YELLOW);
   progress = (160 * currentProgress) / totalProgress;
}

